import React from 'react';
import Layout from '../components/Layout/Layout';
import CountryList from "../components/CountryList/CountryList";
// import {countryProps} from '../components/Countries/CountryInterface';
import Figure from "../components/Figure/Figure";
import InputField from "../components/InputField/InputField";
import Contact from "../components/Contact/Contact";
import Resource from "../components/RenderProps/Resource";

const Components = () => {
    const data = [
        {
            id: 1,
            name: "Aruba",
            currency: "FL"
        },
        {
            id: 2,
            name: "Brazil",
            currency: "BRL"
        },
        {
            id: 3,
            name: "England",
            currency: "POUND"
        },
        {
            id: 4,
            name: "Japan",
            currency: "YEN"
        }
    ];
    return (
        <Layout page="Components">
                <CountryList/>
                <Figure type="large"/>
                <Figure type="medium" />
                <Figure type="x-large"/>
            <InputField name="test" type="name" maxValue={25}/>
            <Resource render={data => {
                return data.map(u => <p>{u}</p>)
            }} />
            <Contact/>
        </Layout>
    )
};

export default Components;
